{{DISPLAYTITLE:A_ImpDeath}}
'''A_ImpDeath'''<br />
(no parameters)

Clears the calling actor's SOLID flag and sets its FLOORCLIP flag instead.

This codepointer is restricted to {{Class|HereticImp}} and derived classes.

